window.bookSummaryJSON = "<p>I may have reached my breaking point. As if trying to graduate from a school for supernaturals isn’t stressful enough, my relationship status has gone from complicated to a straight-up dumpster fire.<br> <br> Oh, and the Bloodletter has decided to drop a bomb of epic proportions on us all...<br> <br> Then again, when has anything at Katmere Academy not been intense?<br> <br> And the hits just keep coming. Jaxon’s turned colder than an Alaskan winter. The Circle is splintered over my upcoming coronation. As if things couldn’t get worse, now there’s an arrest warrant for Hudson’s and my supposed crimes—which apparently means a lifetime prison sentence with a deadly unbreakable curse.<br> <br> Choices will have to be made...and I fear not everyone will survive.<br> <br> Adapted from the novel and produced with a full cast of actors, immersive sound effects and cinematic music!<br> <br> Performed by Melody Muze, Yenni Ann, Wyn Delano, Stewart Crank, Anthony Palmini, Gabriel Michael, Sara Matsui-Colby, Dawn Ursula, Eva Wilhelm, David Cui Cui, Khaya Fraites, Donald Guzzi, Eric Messner, Lena Lee, Lise Bruneau, Daniel Llaca, Megan Dominy, Mark Harrietha, Bradley Foster Smith, Christopher Williams, Julie Hoverson, Carolyn Kashner, Nora Achrati, Bill Gillett, Joe Mallon, Jonathan Lee Taylor, Richard Rohan, and Julienne Irons.</p>"; 
